import Footer from './Footer';
import DiceB from './DiceB';


class App extends Component {

    render() {
        return (
            <BrowserRouter>
                <div className="App">
                    <div>
                        <Routes>
                            <Route path="/" element={<BuySellTokens />} />
                            <Route path="/Dice" element={<Dice />} />
                        </Routes>
                    </div>
                    <Footer />
                </div>
            </BrowserRouter>
        );
    }

}

export default App;
